import React, { Fragment } from "react";
import { useParams } from "react-router-dom";
import { data } from "../data/data";

export const NewPage = () => {
  const { id } = useParams();
  return (
    <Fragment>
    <div>{data.map((item) => item.id == id && <p key={id}>{item.description}</p>)}</div>
    <div>
      {data.map((item) => item.id == id && item.datas.map((a) => <div>
          <a href={`/${a.link}`}>{a.title}</a>
        </div>))}
    </div>
    </Fragment>
  );
};
